import React from "react";
import AddUser from "./Components/Users/AddUser";
letusers = [];

function App() {
  const createUser = (inf) => {
    users.push(inf);
  };

  return (
    <div>
      <AddUser users={users} onInfHandler={createUser} />
    </div>
  );
}

export default App;
